import React from 'react'

export const VariantWrapper = ({
    id,
    type,
    name,
    required,
}) => {
  return (
    <li className="variant-wrapper">
      <input required={required} 
             type={type} 
             name={name} 
             id={id} />
      <label htmlFor={id}>Ваш ответ</label>
    </li>
  )
}
